import React from 'react';
import logo from './logo.svg';
import './App.css';
import Table from "./components/table";
import PaginacionTabla from "./components/PaginationTabla";
function buildFakeUser() {
    return {
        name: faker.internet.userName(),
        avatar: faker.internet.avatar(),
        email: faker.internet.email(),
        color: faker.internet.color()
    };
}
function App() {
  return (
      <div>
        <h1>wdqwdq</h1>
        <Table id="12"/>
      <table className="table table-hover">
          <thead>
          <tr>
              <th>Id. pedido</th>
              <th>Agregado</th>
              <th>Despacho</th>
              <th>Cliente</th>
              <th />
          </tr>
          </thead>
          <PaginacionTabla
              itemsperpage={1}
              nocolumns={2}
              items={0}
              pagesspan={4}
          />
      </table>
      </div>
  );
}

export default App;
